        <http://vocab.getty.edu/aat/scopeNote/33394> <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://vocab.getty.edu/ontology#ScopeNote> .
        <http://vocab.getty.edu/aat/scopeNote/33394> <http://www.w3.org/1999/02/22-rdf-syntax-ns#value> "Refers to maps representing a region at a level of detail or scale between a plan, which is a small area, and a chorographic map, which is a large regional map. Topographic maps include accurate representations of the location and shape of both natural and manmade features. The term refers to maps of various scales in different nations; it is generally limited to maps at scales of 1:500,000 or larger in the United States, but it often refers to scales of 1:1,000,000 or larger in Russia. The term is often mistakenly interpreted to mean maps that only represent natural relief features."@en .
        <http://vocab.getty.edu/aat/scopeNote/33394> <http://purl.org/dc/terms/contributor> <http://vocab.getty.edu/aat/contrib/10000000> .
        <http://vocab.getty.edu/aat/scopeNote/33394> <http://purl.org/dc/terms/source> <http://vocab.getty.edu/aat/source/2000076211> .
        <http://vocab.getty.edu/aat/scopeNote/33394> <http://purl.org/dc/elements/1.1/identifier> "33394" .
        <http://vocab.getty.edu/aat/scopeNote/33394> <http://purl.org/dc/terms/language> <http://vocab.getty.edu/aat/300388277> .
        <http://vocab.getty.edu/aat/scopeNote/33394> <http://purl.org/dc/terms/language> <http://vocab.getty.edu/language/en> .
        <http://vocab.getty.edu/aat/scopeNote/63920> <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://vocab.getty.edu/ontology#ScopeNote> .
        <http://vocab.getty.edu/aat/scopeNote/63920> <http://www.w3.org/1999/02/22-rdf-syntax-ns#value> "Se refiere a mapas que representan una regi\u00F3n al nivel de detalles o escala entre un plano, que muestra un \u00E1rea peque\u00F1a y un mapa corogr\u00E1fico, que es un mapa de una vasta regi\u00F3n. Los mapas topogr\u00E1ficos incluyen representaciones exactas de la ubicaci\u00F3n y forma de caracter\u00EDsticas tanto naturales como hechas por el hombre. El t\u00E9rmino se refiere a mapas a diferentes escalas en diferentes pa\u00EDses; generalmente se limita su uso a mapas a escalas de 1:500.000 o m\u00E1s en los Estados Unidos, pero a menudo en Rusia se refiere a escalas de 1:1.000.000 o m\u00E1s. El t\u00E9rmino frecuentemente es err\u00F3neamente interpretado como mapas que solamente representan caracter\u00EDsticas de relieves naturales."@es .
        <http://vocab.getty.edu/aat/scopeNote/63920> <http://purl.org/dc/terms/contributor> <http://vocab.getty.edu/aat/contrib/10000131> .
        <http://vocab.getty.edu/aat/scopeNote/63920> <http://purl.org/dc/terms/source> <http://vocab.getty.edu/aat/source/2000051034> .
        <http://vocab.getty.edu/aat/scopeNote/63920> <http://purl.org/dc/elements/1.1/identifier> "63920" .
        <http://vocab.getty.edu/aat/scopeNote/63920> <http://purl.org/dc/terms/language> <http://vocab.getty.edu/aat/300389311> .
        <http://vocab.getty.edu/aat/scopeNote/63920> <http://purl.org/dc/terms/language> <http://vocab.getty.edu/language/es> .
        <http://vocab.getty.edu/aat/scopeNote/81661> <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://vocab.getty.edu/ontology#ScopeNote> .
        <http://vocab.getty.edu/aat/scopeNote/81661> <http://www.w3.org/1999/02/22-rdf-syntax-ns#value> "Verwijst naar kaarten die een regio weergeven op een schaal die ligt tussen die van een plattegrond (die een klein gebied weergeeft) en een chorografische kaart (een grote regionale kaart). Topografische kaarten bevatten nauwkeurige weergaven van de locatie en vorm van zowel natuurlijke als door mensen aangebrachte kenmerken. De term verwijst naar kaarten die in verschillende landen verschillende schalen kunnen hebben, en is in de Verenigde Staten meestal beperkt tot kaarten met een schaal van 1:500.000 of groter, maar in Rusland kan de schaal wel 1:1.000.000 of groter zijn. Vaak wordt de term ten onrechte gebruikt voor kaarten die alleen natuurlijke reli\u00EBfkenmerken weergeven."@nl .
        <http://vocab.getty.edu/aat/scopeNote/81661> <http://purl.org/dc/terms/contributor> <http://vocab.getty.edu/aat/contrib/10000205> .
        <http://vocab.getty.edu/aat/scopeNote/81661> <http://purl.org/dc/terms/source> <http://vocab.getty.edu/aat/source/2000052391> .
        <http://vocab.getty.edu/aat/scopeNote/81661> <http://purl.org/dc/terms/source> <http://vocab.getty.edu/aat/source/2000077523> .
        <http://vocab.getty.edu/aat/scopeNote/81661> <http://purl.org/dc/elements/1.1/identifier> "81661" .
        <http://vocab.getty.edu/aat/scopeNote/81661> <http://purl.org/dc/terms/language> <http://vocab.getty.edu/aat/300388256> .
        <http://vocab.getty.edu/aat/scopeNote/81661> <http://purl.org/dc/terms/language> <http://vocab.getty.edu/language/nl> .
        <http://vocab.getty.edu/aat/scopeNote/135717> <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://vocab.getty.edu/ontology#ScopeNote> .
        <http://vocab.getty.edu/aat/scopeNote/135717> <http://www.w3.org/1999/02/22-rdf-syntax-ns#value> "Bezieht sich auf eine Karte, auf der ein Gebiet mit einem Detailreichtum oder in einem Ma\u00DFstab abgebildet wird, welcher zwischen einem kleinr\u00E4umlichen Plan und einer chorografischen Karte f\u00FCr eine gro\u00DFe Region liegt. Topografische Karten enthalten genaue Abbildungen des Ortes und der Gestalt sowohl nat\u00FCrlicher als auch k\u00FCnstlich geschaffener Merkmale. Der Begriff bezeichnet in unterschiedlichen L\u00E4ndern Karten in verschiedenen Ma\u00DFst\u00E4ben; allgemein wird er in den Vereinigten Staaten f\u00FCr Karten im Ma\u00DFstab 1:500.000 oder gr\u00F6\u00DFer verwendet, aber h\u00E4ufig bezieht er sich auf einen Ma\u00DFstab von 1:1.000.000 oder gr\u00F6\u00DFer in Russland. Der Begriff wird h\u00E4ufig f\u00E4lschlicherweise verstanden, als bezeichne er Karten, die ausschlie\u00DFlich nat\u00FCrliche Reliefs abbilden."@de .
